import React from "react";
import "../styles.css";
import { Link } from "react-router-dom";
import logo from "../images/dazzling.jpg";

function Homepage() {
  return (
    <div
      style={{
        margin: "24px",
        position: "relative",
        backgroundImage: `url(${logo})`,
        backgroundPosition: "center",
        backgroundSize: "cover",
        backgroundRepeat: "no-repeat",
        height: "100vh",
        width: "100vw",
      }}
    >
      <div
        style={{
          position: "absolute",
          right: "0px",
        }}
      >
        <Link to="/login">
          <button
            style={{
              backgroundColor: "#1200b8",
              color: "#ffffff",
              padding: "5px",
            }}
          >
            Login
          </button>
        </Link>
      </div>
      <div style={{ position: "relative" }}>
        <h1
          style={{ color: "#004cff", fontSize: "100px", margin: 0, padding: 0 }}
        >
          인뱅
        </h1>
        <h2
          style={{
            color: "#004cff",
            position: "absolute",
            top: "90px",
            left: "150px",
            transform: "rotate(-24deg)",
          }}
        >
          In-Bang
        </h2>
      </div>
      <p style={{ color: "#004cff" }}>
        <br />
        Are you ready to watch exciting movies? Click the box below to get you
        started!
      </p>
      <p style={{ color: "#004cff" }}>
        <br />
        Website still under development, for more details visit
        localhost:3000/subscription
      </p>
      <Link to="/login">
        <button
          style={{
            backgroundColor: "#1200b8",
            color: "#ffffff",
            padding: "5px",
          }}
        >
          Get Started →
        </button>
      </Link>
    </div>
  );
}

export default Homepage;
